import React from 'react'
import ProjectComponents from './ProjectComponents'
import "./Styles/Projects.css"
import Grid from '@mui/material/Grid';

function Projects() {
  return (
    <Grid container>
      <Grid md = {12}>
        <div className='projectsPage'>
      <ProjectComponents/>
    </div>

      </Grid>
    
    </Grid>
  )
}

export default Projects
